import React, { useEffect } from "react";
import myStyles from './Home.module.css';
import Helmet from 'react-helmet';



const Home = () => {



    return(
        <>
        <Helmet>
            <body />
                <style>
                    {`
                        body{
                            background-color: rgb(254, 244, 246);
                        }
                    `}
                </style>

        </Helmet>


        </>
    )
}

export default Home;
